var journeyCookieName="syncfusion.dashboards.server.journey";function SetJourneyCookie(o){o=JSON.stringify('{ "donot_show_journey": "'+o+'"}');document.cookie=journeyCookieName+"="+o+";expires='Fri, 31 Dec 9999 23:59:59 GMT';path=/;SameSite=Lax"}function getJourneyCookie(){for(var o=journeyCookieName+"=",e=document.cookie.split(";"),n=0;n<e.length;n++){for(var r=e[n];" "==r.charAt(0);)r=r.substring(1);if(0==r.indexOf(o))return r.substring(o.length,r.length)}return""}$(document).on("click","#donot-show-journey",function(){SetJourneyCookie(!0),$(".setup-journey, .tooltip").hide()});